Private Movies 7 (Fallen Angel / 2003)

Julia and her husband, Anthony, attend a friend's party. Julia realizes that something weird is going on, all the men are flirting with her and all the women are surrounding Anthony. Soon the party will become and orgy. This is the starting point of Antonio Adamo's latest movie. A story in which we will see the two protagonists dive into a voluptuous and erotic experience, full of sexy games and couple swapping. Stars such as Rita Faltoyano, Bettina, Julia Taylor, Sandra Russo, Jessica May, Julia Silver, Daniella Schiffer, make this movie extraordinary.

